                        Title = "Off the beaten path",
                        Content = "{\"ops\":[{\"insert\":\"Bordered by the stunning landscapes of the Cambrian Mountains on one side and Cardigan Bay's wild coastline on the other, it's surprising that Mid Wales is often overlooked as a UK travel destination. However, a lack of infrastructure - and industry - within its rugged, barren plains and stark, craggy peaks has allowed it to remain relatively under the radar for visitors.\\n\\nThe county of Ceredigion, located in the heart of Mid Wales, is arguably Wales at its most rural. Dotted with nature reserves and country lanes that are crisscrossed by cycling and walking routes, it's as off-the-beaten-track for travellers as the tiny country gets. Perhaps even lesser known to visitors, though, is that it is believed to have once been home to a sunken ancient forest and mythical kingdom - one that has recently returned to the limelight.\\n\\nSnowdonia\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"Rocky, rough and tough that's how we like our mountains. Don't think that just because you can take a train to the top, Snowdon isn't a proper peak. In fact, \"},{\"attributes\":{\"color\":\"#135d78\",\"link\":\"https://www.visitwales.com/destinations/north-wales/snowdonia\"},\"insert\":\"Snowdonia National Park\"},{\"insert\":\" is a mountain and adventure capital that's up there with the classic Alpine destinations.\\nEach of the six official eight-mile routes to the highest mountain in Wales (1085m) offer sensational hiking and incredible views. In Snowdonia's nine ranges, there are 15 peaks over 900m high, including Snowdon itself. You may have heard of some of the others. \"},{\"attributes\":{\"color\":\"#135d78\",\"link\":\"https://www.nationaltrust.org.uk/carneddau-and-glyderau/features/tryfan\"},\"insert\":\"Tryfan\"},{\"insert\":\" (918m) is a famous landmark: a triangular peak offering some of the best scrambling and views in Britain. Meanwhile, Cader Idris is 893m high and rears up from the shores of the beautiful Mawddach Estuary.\\n\"},{\"insert\":{\"image\":\"data:image/jpeg;base64,\"}},{\"insert\":\"\\n\\nCambrian Mountains\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"Cambrian Mountains is a name thats sometimes used literally, to mean the rocky spine that reaches all the way from the craggy heights of Snowdonia to the softer peaks of the Brecon Beacons. In other words, all the mountains in Wales. But it's also used more specifically to describe the Mid Wales uplands the sparsely-populated landscape from Plynlimon (752m) near Machynlleth, to Mallaen (462m) near Llandovery.\\nThe Cambrian Mountains are separated from Snowdonia and the Black Mountain Range by the Dyfi and Tywi valleys. They're home to the sources of the Wye and the Severn, the peaceful Elan Valley reservoirs, and miles of wild scenery where you can spot owls and other birds of prey.\\n\"},{\"insert\":{\"image\":\"data:image/jpeg;base64,\"}},{\"insert\":\"\\n\"}]}",
