                        Content = "{\"ops\":[{\"insert\":{\"image\":\"data:image/jpeg;base64,\"}},{\"insert\":\"\\nIn \\\"Little Fire Everywhere,\\\" a new limited series on Hulu based on the Celeste Ng book of the same name, Reese Witherspoon plays a Type-A, upper-middle-class mom who lives her life by a structure carefully constructed by her.\\n\\n\"},{\"attributes\":{\"background\":\"#fefefe\",\"color\":\"#262626\"},\"insert\":\"To the untrained eye, the role might give one a little Deja Witherspoon. After all, some of her most famous characters, including the recently hailed one she played on HBO's \\\"Big Little Lies,\\\" are cut from a similar high-achieving cloth.\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"background\":\"#fefefe\",\"color\":\"#262626\"},\"insert\":\"Madeline is a mom keeping it together, balancing kids, shade-filled coffee dates and, eventually, a murder coverup. Proof of Witherspoon's ability to excel as a Type-A-er is that she was in the company of one of the most extraordinary and accomplished acting ensembles and still managed to steal scenes with her one-liners.\"},{\"insert\":\"\\n\\nYou know you've created a perfect character when, over time, their name can be used as an adjective and is worn as a badge of honor among women with laser-focused ambition.\\n\\nAnyone who writes a manifesto about their intentional lack of a sex life is, indeed, an overachiever. But Witherspoon channeled innocent Annette with just enough simmering slyness to pull off the character's epic power moves.\\n\"}]}",
