                        IsDeleted = false,
                        Title = "Charles Leclerc completes esports quadruple",
                        Content = "{\"ops\":[{\"insert\":{\"image\":\"data:image/jpeg;base64,\"}},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"He scored four pole positions in a row in his first season for Ferrari last year. And after only a couple of weeks of practice Charles Leclerc has now completed an unprecedented quadruple.\"},{\"insert\":\"\\n\\nWell, we have no idea if it's unprecedented, given how many people have games consoles, but Leclerc's having quite the week when it comes to driving his Ferrari from the no doubt considerable comfort of his Monaco home.\\nYeah, he's into esports - and sim racing in particular - in a big way.\\nOn Sunday the 22-year-old won his fourth major esports race in row - the Formula 1 Virtual China Grand Prix (it would have been the proper Chinese GP this weekend). Qualifying on pole position, he drove yet another flawless race, beating Red Bull's Alex Albon.\\nIn a field of 19 - including F1 drivers, racers from other series and notable other sportspeople - Leclerc was the class of the grid.\\n\\nIn case you were wondering, all the professional racing drivers finished ahead of the 'guests', which included golfer Ian Poulter, Real Madrid and former Chelsea goalkeeper Thibaut Courtois and Lazio striker Ciro Immobile.\\nThe star of the stars had to be Poulter, who finished last after crashing his Renault while being interviewed by the commentators with three laps to go.\\n\\\"I've never sweated so much. You've got me all flustered,\\\" he said as he hit the wall at the beginning of the start-finish straight.\\n\"}]}",
                        UserId = "7058514a-2979-46dc-81c2-d315d6b8a47b",  // ivan UserName (Reporter Role)
                        CreatedAt = DateTime.Parse("2020-04-20 13:50:34.2388711"),
                        UpdatedAt = DateTime.Parse("2020-04-23 16:55:32.0088457")
                    },

                    new News
                    {
                        Id = "bd961342-c33b-4e8b-b522-ff692cc2e39b",
                        IsDeleted = false,
                        Title = "Zoom's Security Woes Were No Secret to Business Partners Like Dropbox",
                        Content = "{\"ops\":[{\"attributes\":{\"bold\":true},\"insert\":\"Dropbox privately paid top hackers to find bugs in software by the videoconferencing company Zoom, then pressed it to fix them.\"},{\"insert\":{\"image\":\"data:image/jpeg;base64,\"}},{\"attributes\":{\"align\":\"center\",\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"One year ago, two Australian hackers found themselves on an eight-hour flight to Singapore to attend a \"},{\"attributes\":{\"color\":\"#326891\",\"link\":\"https://www.hackerone.com/blog/hacking-dropbox-live-heart-singapore-h1-65\"},\"insert\":\"live hacking competition\"},{\"insert\":\" sponsored by Dropbox. At 30,000 feet, with nothing but a slow internet connection, they decided to get a head start by hacking Zoom, a videoconferencing service that they knew was used by many Dropbox employees.\\nThe hackers soon uncovered a \"},{\"attributes\":{\"color\":\"#326891\",\"link\":\"https://blog.assetnote.io/bug-bounty/2019/07/17/rce-on-zoom/\"},\"insert\":\"major security vulnerability\"},{\"insert\":\" in Zoom's software that could have allowed attackers to covertly control certain users' Mac computers. It was precisely the type of bug that security engineers at Dropbox had come to dread from Zoom, according to three former Dropbox engineers.\\nNow Zoom's videoconferencing service has become \"},{\"attributes\":{\"color\":\"#326891\",\"link\":\"https://www.nytimes.com/2020/03/17/style/zoom-parties-coronavirus-memes.html\"},\"insert\":\"the preferred communications platform\"},{\"insert\":\" for hundreds of millions of people sheltering at home, and reports of \"},{\"attributes\":{\"color\":\"#326891\",\"link\":\"https://www.nytimes.com/2020/03/30/technology/new-york-attorney-general-zoom-privacy.html\"},\"insert\":\"its privacy and security\"},{\"insert\":\" troubles have proliferated.\\nZoom's defenders, including big-name Silicon Valley venture capitalists, say the onslaught of criticism is unfair. They argue that Zoom, originally designed for businesses, could not have anticipated a pandemic that would send legions of consumers flocking to its service in the span of a few weeks and using it for purposes   like elementary school classes and family celebrations for which it was never intended.\\nI don't think a lot of these things were predictable, said \"},{\"attributes\":{\"color\":\"#326891\",\"link\":\"https://www.nytimes.com/2018/08/01/technology/facebook-security-alex-stamos.html\"},\"insert\":\"Alex Stamos, a former chief security officer at Facebook\"},{\"insert\":\" who recently signed on as a security adviser to Zoom. It's like everyone decided to drive their cars on water.\\nThe former Dropbox engineers, however, say Zoom's current woes can be traced back two years or more, and they argue that the company's failure to overhaul its security practices back then put its business clients at risk.\\n\"}]}",
                        UserId = "7058514a-2979-46dc-81c2-d315d6b8a47b",  // ivan UserName (Reporter Role)
                        CreatedAt = DateTime.Parse("2020-04-27 17:00:32.9350742"),
                        UpdatedAt = DateTime.Parse("2020-04-28 19:55:32.1237642")
                    },

                    new News
                    {
                        Id = "5f2b59ed-74a7-4e24-96bd-ec9b44ab3df9",
                        IsDeleted = false,
                        Title = "History's deadliest air raid happened in Tokyo during World War II and you've probably never heard of it",
                        Content = "{\"ops\":[{\"insert\":{\"image\":\"data:image/jpeg;base64,\"}},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Tokyo (CNN) - \"},{\"insert\":\"Everywhere she turned, 8-year-old Haruyo Nihei saw flames.\\nBombs dropped by the Americans had created tornadoes of fire so intense that they were sucking mattresses from homes and hurling them down the street along with furniture -- and people.\\n\\n\\\"The flames consumed them, turning them into balls of fire,\\\" says Nihei, now 83.\\nNihei had been asleep when the bombs began raining down on Tokyo, then a city comprised of mostly wooden houses, prompting her to flee the home she shared with her parents, her older brother and her younger sister.\\nAs she raced down her street, the superheated winds set her fireproof wrap ablaze.She briefly let go of her father's hand to toss it off. At that moment, he was swept away into the crush of people trying to escape.\\nAs the flames closed in, Nihei found herself at a Tokyo crossroad, screaming for her father. A stranger wrapped himself around her to protect her from the flames. As more people piled into the intersection, she was pushed to the ground.\\nAs she drifted in and out of consciousness beneath the crush, she remembers hearing muffled voices above: \\\"We are Japanese. We must live. We must live.\\\" Eventually, the voices became weaker. Until silence.\\nWhen Nihei was finally pulled out from the pile of people, she saw their bodies charred black. The stranger who had protected her was her father. After falling to the ground, they'd both been shielded\"},{\"attributes\":{\"bold\":true},\"insert\":\" \"},{\"insert\":\"from the fire by the charred corpses that were now at their ankles.\\nIt was the early morning of March 10, 1945, and Nihei had just survived the deadliest bombing raid in human history.\\n\"}]}",
                        UserId = "7058514a-2979-46dc-81c2-d315d6b8a47b",  // ivan UserName (Reporter Role)
                        CreatedAt = DateTime.Parse("2020-05-22 14:15:17.1935745"),
                        UpdatedAt = DateTime.Parse("2020-06-23 18:19:13.0931354")
                    },

                    new News
                    {
                        Id = "d29023e4-131b-4b7c-9892-fa04426cf73e",
                        IsDeleted = false,
                        Title = "ISIS members riot and break out of Syrian prison",
                        Content = "{\"ops\":[{\"insert\":{\"image\":\"data:image/png;base64,\"}},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(CNN) - \"},{\"insert\":\"Several Islamic State in Iraq and Syria (ISIS) members escaped from a Syrian prison on Sunday by ripping off doors and using them to break down a wall during a \\\"detention facility uprising,\\\" authorities said.\\nThe Ghweran prison, located in the northeastern city of Hasakah, is run by the Kurdish Syrian Democratic Forces (SDF), a key US partner in the fight against ISIS.\\nISIS prisoners took over the first floor floor of the prison, tore down some of the internal walls, and destroyed the doors, Mustafa Bali, head of the SDF press office, said \"},{\"attributes\":{\"color\":\"#006598\",\"link\":\"https://twitter.com/mustefabali/status/1244375074070822912\"},\"insert\":\"in a tweet\"},{\"insert\":\" Sunday.\\n\\\"Some of them managed to escape and the search for them is ongoing,\\\" he added.\\nInside, prisoners staged a riot that authorities struggled to control. \\\"The situation is tense inside the prison currently \\\" Bali said. \\\"The anti-terrorist forces are dealing with the situation to restore control of the ground floor in the prison and restore calm to the prison in general.\\\"\\nA US military official confirmed to CNN Sunday that there was an ongoing situation at the prison. CNN reporters on the ground could hear loud chanting from prisoners inside.\\nThe identities of the ISIS members who escaped, and how many of them did, is not yet clear.\\nThe US-led military coalition fighting ISIS is providing aerial surveillance assistance in an attempt to find them, the coalition said in a statement.\\n\\\"The SDF is quelling the insurrection. The Hasakah facility holds low-level ISIS members. The Coalition does not staff any detention facilities or camps in Syria,\\\" said the statement.\\nThe SDF is responsible for all ISIS prisons in northern Syria. These camps and prisons hold some \"},{\"attributes\":{\"color\":\"#006598\",\"link\":\"https://edition.cnn.com/2019/10/09/politics/isis-prisoners-turkey-syria/index.html\"},\"insert\":\"11,000 to 12,000 ISIS fighters\"},{\"insert\":\" captured on the battlefield, as well as those displaced by the fight against ISIS.\\n\"}]}",
                        UserId = "7058514a-2979-46dc-81c2-d315d6b8a47b",  // ivan UserName (Reporter Role)
                        CreatedAt = DateTime.Parse("2020-03-23 12:23:15.9375245"),
                        UpdatedAt = DateTime.Parse("2020-03-29 18:45:19.5467214")
                    },

                    new News
                    {
                        Id = "24e2329c-afe3-4a87-a25a-b16715acb985",
                        IsDeleted = false,
                        Title = "Meghan and Harry tell four British tabloids they can expect 'zero engagement'",
                        Content = "{\"ops\":[{\"insert\":{\"image\":\"data:image/jpeg;base64,\"}},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"London (CNN Business)\"},{\"insert\":\"\\nThe \"},{\"attributes\":{\"color\":\"#262626\",\"link\":\"https://edition.cnn.com/2020/03/31/world/prince-harry-meghan-new-roles-intl/index.html\"},\"insert\":\"Duke and Duchess of Sussex\"},{\"insert\":\" are cutting off all dealings with four of the United Kingdom's biggest tabloid newspapers after \"},{\"attributes\":{\"color\":\"#262626\",\"link\":\"https://edition.cnn.com/2020/01/10/media/tabloids-meghan-harry-headlines/index.html\"},\"insert\":\"years of strained relations\"},{\"insert\":\".\\nThe newspapers the Daily Mail, the Sun, the Mirror and the Express were notified of the new policy in a letter sent on Sunday on behalf of Meghan and Harry and shared with CNN by a source close to the couple. The couple's new approach also applies to the Sunday and online editions of those publications.\\nIn the letter, the couple say they believe a free press \\\"is a cornerstone to any democracy\\\" but add that \\\"there is a real human cost\\\" to the way the tabloids go about their business.\\n\\n\\\"It is gravely concerning that an influential slice of the media, over many years, has sought to insulate themselves from taking accountability for what they say or print even when they know it to be distorted, false, or invasive beyond reason. When power is enjoyed without responsibility, the trust we all place in this much-needed industry is degraded,\\\" the letter states.\\nThe couple have had a rough time with the media since getting together and have spoken out against what they say is the relentless and aggressive coverage of Meghan in particular. Prince Harry has described some of the coverage of his wife as containing \\\"racial undertones.\\\"\\nLast year, 72 female members of the UK parliament authored a joint letter condemning coverage of her, calling it \\\"colonial,\\\" \\\"outdated,\\\" and an invasion of privacy.\\n\\nThe letter sent to the British papers states that the Duke and Duchess and their communications team will not engage with the outlets in any way. \\\"There will be no corroboration and zero engagement,\\\" it explains.\\n\\\"This policy is not about avoiding criticism,\\\" the letter continues. \\\"It's not about shutting down public conversation or censoring accurate reporting. Media have every right to report on and indeed have an opinion on The Duke and Duchess of Sussex, good or bad. But it can't be based on a lie.\\\"\\n\\\"What they won't do is offer themselves up as currency for an economy of clickbait and distortion.\\\"\\nIn the wake of the the couple's shock announcement in January that they were planning to step away from their official duties as working members of the royal family, several British tabloids have increased their focus on \"},{\"attributes\":{\"color\":\"#262626\",\"link\":\"https://edition.cnn.com/2020/01/10/media/tabloids-meghan-harry-headlines/index.html\"},\"insert\":\"Meghan\"},{\"insert\":\", dubbing the move \\\"Megxit.\\\" Some have accused her of turning Harry into a \\\"joker\\\" and leaving him behind to deal with the fall out while she rejoined their son in Canada.\\nHarry and Meghan have also torn up the traditional way the royal family has dealt with the press, first by announcing they would \"},{\"attributes\":{\"color\":\"#262626\",\"link\":\"https://edition.cnn.com/2020/01/09/media/meghan-harry-royal-media/index.html\"},\"insert\":\"no longer participate in the\"},{\"insert\":\" pool of British journalists that for decades has covered all royal events and shares information and photos with other media.\\n\"}]}",
                        UserId = "7058514a-2979-46dc-81c2-d315d6b8a47b",  // ivan UserName (Reporter Role)
                        CreatedAt = DateTime.Parse("2020-04-20 14:28:57.0960077"),
                        UpdatedAt = DateTime.Parse("2020-04-20 14:28:57.0960077"),
                    },

                    new News
                    {
                        Id = "a800fe02-2de8-464f-9bfd-7693211973d9",
                        IsDeleted = false,
                        Title = "Julian Castro: Here's how we can prevent the next housing crisis",
                        Content = "{\"ops\":[{\"insert\":\"The Department of Labor has \"},{\"attributes\":{\"color\":\"#262626\",\"link\":\"https://www.cnn.com/2020/04/16/economy/unemployment-benefits-coronavirus/index.html?utm_content=2020-04-16T12%3A37%3A41&utm_medium=social&utm_source=twbusiness&utm_term=link\"},\"insert\":\"announced\"},{\"insert\":\" that about 22 million Americans have filed for unemployment since the coronavirus crisis started shutting down businesses in the United States. That means a large percentage of the nation's renters and homeowners sat around their kitchen tables as the rent or mortgage payments came due at the first of the month and wondered where the money would come from.\\nHousing is the biggest monthly expense for most Americans, but it's often shoved aside in our political discourse for other important issues like health care, immigration or taxes. The federal government's response to the Covid-19 pandemic is a prime example of this and more needs to be done.\\nThe US Department of Housing and Urban Development \"},{\"attributes\":{\"color\":\"#262626\",\"link\":\"https://www.cnn.com/2020/03/18/politics/trump-hud-evictions-foreclosures/index.html\"},\"insert\":\"announced\"},{\"insert\":\" in mid-March that it would suspend foreclosures and evictions for the \"},{\"attributes\":{\"color\":\"#262626\",\"link\":\"https://www.hud.gov/sites/dfiles/Housing/documents/2019FHAAnnualReportMMIFund.pdf\"},\"insert\":\"8.1 million mortgages\"},{\"insert\":\" insured by the Federal Housing Administration. In its $2.2 trillion economic stabilization package, Congress included more than $12 billion for housing and protection from eviction and foreclosures. While these measures are important, they won't be nearly enough to keep millions of Americans from housing insecurity and prevent a crisis worse than the Great Recession.\\nLong before Covid-19, stagnant wages, a severe lack of affordable housing and discriminatory housing practices had created an affordability crisis in communities across the nation.\\nIn the United States, 43.7 million households rent their homes or apartments. More than \"},{\"attributes\":{\"color\":\"#262626\",\"link\":\"https://www.census.gov/library/stories/2019/11/decade-after-the-recession-housing-costs-ease-for-homeowner.html\"},\"insert\":\"40%\"},{\"insert\":\" of renters spent at least 35% or more of their monthly paycheck on rent and utilities in 2018, meaning they are rent burdened.\\n\"},{\"insert\":{\"image\":\"data:image/jpeg;base64,\"}},{\"insert\":\"\\n\\nPeople prepare places to sleep in area marked by painted boxes on the ground of a parking lot at a makeshift camp for the homeless Monday, March 30, 2020, in Las Vegas.\\nHomeless people in the United States are still facing injustices as well. Images from Las Vegas \"},{\"attributes\":{\"color\":\"#262626\",\"link\":\"https://www.cnn.com/2020/03/30/us/coronavirus-las-vegas-homeless-cashman-center-trnd/index.html\"},\"insert\":\"showed\"},{\"insert\":\" dozens of homeless residents sleeping in \\\"social distancing boxes\\\" painted in a parking lot adjacent to the Strip. In a city with \"},{\"attributes\":{\"color\":\"#262626\",\"link\":\"https://www.lvcva.com/stats-and-facts/visitor-statistics/faq/\"},\"insert\":\"almost 150,000\"},{\"insert\":\" hotel rooms, many of which are currently empty, it's a moral and policy failure that people must sleep in a painted square in the shadow of massive casinos.\\nTo people experiencing homelessness, a \\\"stay at home order\\\" is a dark reminder that they have no home in which to shelter in the first place.\\nTo their credit, some states have already put a \"},{\"attributes\":{\"color\":\"#262626\",\"link\":\"https://www.clickorlando.com/news/local/2020/04/10/despite-notice-florida-tenants-cant-be-evicted-during-governors-moratorium-on-evictions/\"},\"insert\":\"moratorium\"},{\"insert\":\" on foreclosures and evictions. Some have even offered financial relief and protections to renters, mortgage holders and landlords. The federal government should do the same but it should also tackle the broader housing affordability crisis.\\nOver the course of the 2020 campaign, my competitors and I laid out a number of housing proposals that would dramatically boost housing opportunity for Americans. I called for transforming the Housing Choice Voucher program (better known as Section 8) into a fully-funded federal entitlement program. The program, which was designed to target families with the highest need, increase mobility and combat housing insecurity, currently only covers a quarter of eligible families. I believe the program should cover all families making less than 50% of a community's median income, which \"},{\"attributes\":{\"color\":\"#262626\",\"link\":\"http://www.cbo.gov/sites/default/files/114th-congress-2015-2016/reports/50782-lowincomehousing-onecolumn.pdf\"},\"insert\":\"would cost\"},{\"insert\":\" $410 billion over 10 years.\\n\"}]}",
                        UserId = "7058514a-2979-46dc-81c2-d315d6b8a47b",  // ivan UserName (Reporter Role)
                        CreatedAt = DateTime.Parse("2020-02-13 16:45:17.8641578"),
                        UpdatedAt = DateTime.Parse("2020-02-15 18:21:14.9542146")
                    }
                };

